import React from 'react';
import {
Nav,
NavLink,
NavMenu,
NavBtn,
NavBtnLink,
} from './NavBar';

const Navbar = () => {

	return (
		<>
		<Nav>
				<NavLink to='/' >
					<h1>WhatsTheHaps?</h1>
				</NavLink>	
				<NavMenu className='navigation'>		
				<NavLink to='/about' activeStyle>
					About us
				</NavLink>		
				<NavLink to='/terms' activeStyle>
					Terms and conditions
				</NavLink>	
				</NavMenu>
				<NavBtn>
				<NavBtnLink to='/signin'>Sign In</NavBtnLink>
				</NavBtn>

		</Nav>
		</>
	);
};

export default Navbar;
